import React from "react";

function Jumbotron() {
  return (
    <div
      style={{ height: 100, clear: "both", paddingTop: 25, marginTop:10, textAlign: "center" }}
      className="jumbotron"
    >
    Welcome to My Project !!!
    </div>
  );
}

export default Jumbotron;
